<template>
  <button
    class="fixed right-11 bottom-10"
    @click="toggleDarkMode"
  >
    <!-- sun -->
    <svg v-if="isDark" class="h-10 w-10" viewBox="0 0 75 75" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
      <circle cx="37.5" cy="37.5" r="37.5" fill="white"/>
      <rect x="15" y="15" width="45" height="45" fill="url(#pattern0)"/>
      <defs>
      <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
      <use xlink:href="#image0_108_12" transform="scale(0.015625)"/>
      </pattern>
      <image id="image0_108_12" width="64" height="64" xlink:href="data:image/png;base64,"/>
      </defs>
    </svg>

    <!-- moon -->
    <svg v-else class="h-10 w-10" viewBox="0 0 75 75" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
      <circle cx="37.5" cy="37.5" r="37.5" fill="#333333"/>
      <rect x="15" y="15" width="45" height="45" fill="url(#pattern0)"/>
      <defs>
      <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
      <use xlink:href="#image0_53_51" transform="scale(0.00195312)"/>
      </pattern>
      <image id="image0_53_51" width="512" height="512" xlink:href="data:image/png;base64,"/>
      </defs>
    </svg>

  </button>
</template>

<script>
export default {
  name: 'DarkModeButton',
  data: function() {
    return {
      isDark: localStorage.theme ==='dark' ? true : false,
    }
  },
  methods: {
    toggleDarkMode() {
      if (localStorage.theme === 'dark') {
        document.documentElement.classList.remove('dark')
        localStorage.theme = 'light'
        this.isDark = false
      } else {
        document.documentElement.classList.add('dark')
        localStorage.theme = 'dark'
        this.isDark = true
      }
    },
  },
}
</script>

